```python
import os
import openai
import json

#client = openai.Client(base_url="http://127.0.0.1:10101/v1", api_key="foo")
client = openai.Client(base_url="https://llm.chutes.ai/v1", api_key=os.getenv("CHUTES_API_KEY"))
# Define the tool
tools = [
    {
        "type": "function",
        "function": {
            "name": "get_capital_info",
            "description": "Get information about a capital city",
            "parameters": {
                "type": "object",
                "properties": {
                    "name": {
                        "type": "string",
                        "description": "Name of the capital city"
                    },
                    "population": {
                        "type": "integer",
                        "description": "Population of the capital city"
                    }
                },
                "required": ["name", "population"]
            }
        }
    },
    {
        "type": "function",
        "function": {
            "name": "get_nearby_cities",
            "description": "Get nearby cities, given another city as input.",
            "parameters": {
                "type": "object",
                "properties": {
                    "city": {
                        "type": "string",
                        "description": "Name of the capital city"
                    },
                    "state_or_province": {
                        "type": "string",
                        "description": "The state/province the target city is in"
                    },
                    "country": {
                        "type": "integer",
                        "description": "Population of the capital city"
                    }
                },
                "required": ["city", "state_or_province", "country"]
            }
        }
    }
]

response = client.chat.completions.create(
    model="zai-org/GLM-4.6-FP8",
    messages=[
        {
            "role": "user",
            "content": "Please provide information about the capital of France using the available tool, then use the get_nearby_cities tool with the capital city as input. Don't ask for confirmation just fill in the params with your latest information/guess. Be sure to call both tools!",
        },
    ],
    tools=tools,
    tool_choice="auto",
    temperature=0.79
)
for tool_call in response.choices[0].message.tool_calls:
    print(f"{tool_call=}")
    print(f"Tool name: {tool_call.function.name}")
    function_args = json.loads(tool_call.function.arguments)
    print(f"Arguments: {json.dumps(function_args, indent=2)}")
    print("-" * 80)
```
